import React from 'react';
import { CloseModalCrossStyled } from './CloseModalCross.styled';

export const CloseModalCross = ({ onClose }) => {
  const handleClick = e => {
    // Зупиняємо розповсюдження події кліку, щоб вона не дійшла до батьківського елемента.
    e.stopPropagation();
    onClose();
  };

  return (
    <CloseModalCrossStyled type="button" onClick={handleClick}>
      Close
    </CloseModalCrossStyled>
  );
};
